              <text fill="white" xml:space="preserve" style="white-space: pre" font-family="Inter" font-size="28" letter-spacing="0em"><tspan x="1177" y="224.182">DIRECTOR</tspan></text>
              <text fill="white" xml:space="preserve" style="white-space: pre" font-family="Inter" font-size="64" font-weight="800" letter-spacing="0em"><tspan x="927" y="733.773">INFO</tspan></text>
              <text fill="black" fill-opacity="0.61" xml:space="preserve" style="white-space: pre" font-family="Inter" font-size="24" font-weight="300" letter-spacing="0em"><tspan x="1386" y="712.227">Mr Ferdinand Clooney is confident and </tspan><tspan x="1386" y="741.227">aggressive in his approach to gain resources </tspan><tspan x="1386" y="770.227">and support for Rhine, which drives forward </tspan><tspan x="1386" y="799.227">many research projects.</tspan></text>

              <text fill="black" xml:space="preserve" style="white-space: pre" font-family="Inter" font-size="4" font-weight="300" letter-spacing="0em"><tspan x="75" y="336.955">Ferdinand is the head of Rhine Lab&#39;s Energy Section and one of its first </tspan><tspan x="75" y="341.955">members alongside Ahrens Parvis. &#10;</tspan><tspan x="75" y="346.955">&#10;</tspan><tspan x="75" y="351.955">He is known for his aggressive yet confident approach in gathering </tspan><tspan x="75" y="356.955">resources to support Rhine Lab and drive its projects forward, and often </tspan><tspan x="75" y="361.955">projects an intelligent yet domineering presence who cares more about </tspan><tspan x="75" y="366.955">the tangible worth of projects rather than the projects or makers </tspan><tspan x="75" y="371.955">themselves. &#10;</tspan><tspan x="75" y="376.955">&#10;</tspan><tspan x="75" y="381.955">To that end, he is known to engage in shady dealings such as secretly </tspan><tspan x="75" y="386.955">supplying Rhine-made equipment to external parties, such as </tspan><tspan x="75" y="391.955">corporations, mercenary groups, or even the Union Army of Columbia </tspan><tspan x="75" y="396.955">through his collaboration with an anoynmous &#34;Colonel.&#34;</tspan></text>
